// src/index.js
import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';
import Modal from 'react-modal';

Modal.setAppElement('#root');
const root = createRoot(document.getElementById('root'));
root.render(
  <>
  <React.StrictMode>
      <App/>
  </React.StrictMode>
  </>
);
